import React from 'react';

const LoginCerberus = () => {
  let intro = {
    svg: '/logo/Cerberus_logo.svg',
    name: 'cerberus'
  };

  return (
    <div className="login">
      <div className="intro">
        <h2 className="subtitle">NO BUGS</h2>
        <h1 className="title">ALLOW</h1>
        <img src={process.env.PUBLIC_URL + intro.svg} alt="" width="100px"/>
      </div>
      <form id="login"></form>
    </div> 
    );
}

export default LoginCerberus;
